import { createSelector } from "@reduxjs/toolkit";

export const getUser = (state = createSelector(
  (state) => state.user,
  (user) => user.user
));
export const getAccessToken = (state = createSelector(
  (state) => state.user,
  (user) => user.accessToken
));
